import React, { useState, useEffect } from "react";
import "../styles/AdminDashboard.css";

function AdminDashboard() {
  const [activeMenuItem, setActiveMenuItem] = useState("home");
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  // Theme management
  useEffect(() => {
    const savedTheme = localStorage.getItem('theme') || 'light';
    setIsDarkMode(savedTheme === 'dark');
    document.documentElement.classList.toggle('dark', savedTheme === 'dark');
  }, []);

  const toggleTheme = () => {
    const newTheme = isDarkMode ? 'light' : 'dark';
    setIsDarkMode(!isDarkMode);
    localStorage.setItem('theme', newTheme);
    document.documentElement.classList.toggle('dark');
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  const showPage = (pageId) => {
    setActiveMenuItem(pageId);
    if (window.innerWidth < 1024) {
      setIsMobileMenuOpen(false);
    }
  };

  const menuItems = [
    { id: "home", label: "Home", icon: "fas fa-home" },
    { id: "patients", label: "My Patients", icon: "fas fa-users" },
    { id: "appointments", label: "Appointments", icon: "fas fa-calendar-check" },
    { id: "prescriptions", label: "Prescriptions", icon: "fas fa-prescription-bottle" },
    { id: "analytics", label: "Health Analytics", icon: "fas fa-chart-line" },
    { id: "account", label: "Profile", icon: "fas fa-user-cog" },
    { id: "settings", label: "Settings", icon: "fas fa-cog" }
  ];

  return (
    <>
      {/* Add Font Awesome */}
      <link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css" rel="stylesheet" />
      
      <div className="admin-container">
        {/* Mobile menu overlay */}
        {isMobileMenuOpen && (
          <div 
            style={{
              position: 'fixed',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              backgroundColor: 'rgba(0, 0, 0, 0.5)',
              zIndex: 40,
              display: window.innerWidth >= 1024 ? 'none' : 'block'
            }}
            onClick={toggleMobileMenu}
          ></div>
        )}

        {/* Sidebar */}
        <div className="sidebar" style={{
          transform: isMobileMenuOpen ? 'translateX(0)' : window.innerWidth < 1024 ? 'translateX(-100%)' : 'translateX(0)',
          position: window.innerWidth < 1024 ? 'fixed' : 'relative',
          zIndex: 50,
          transition: 'transform 0.3s ease-in-out'
        }}>
          <h2>MedConnect</h2>
          <ul>
            {menuItems.map((item) => (
              <li
                key={item.id}
                className={activeMenuItem === item.id ? "active" : ""}
                onClick={() => showPage(item.id)}
                style={{ display: 'flex', alignItems: 'center', gap: '12px' }}
              >
                <i className={item.icon}></i>
                <span>{item.label}</span>
              </li>
            ))}
          </ul>
        </div>

        {/* Main Content */}
        <div className="main-content">
          {/* Top Navigation */}
          <div className="navbar">
            <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
              <button
                onClick={toggleMobileMenu}
                style={{
                  display: window.innerWidth >= 1024 ? 'none' : 'block',
                  padding: '8px',
                  borderRadius: '6px',
                  border: 'none',
                  backgroundColor: 'transparent',
                  cursor: 'pointer'
                }}
              >
                <i className="fas fa-bars" style={{ color: '#6b7280' }}></i>
              </button>
              <h2 style={{ fontSize: '20px', fontWeight: '600', color: '#1f2937', margin: 0 }}>Doctor Dashboard</h2>
            </div>

            <div className="profile">
              {/* Search Bar */}
              <div style={{ position: 'relative', display: window.innerWidth < 640 ? 'none' : 'block' }}>
                <input
                  type="text"
                  placeholder="Search patients..."
                  onKeyPress={(e) => {
                    if (e.key === 'Enter') {
                      alert(`Searching for patient: ${e.target.value}`);
                    }
                  }}
                />
                <i className="fas fa-search" style={{
                  position: 'absolute',
                  left: '12px',
                  top: '50%',
                  transform: 'translateY(-50%)',
                  color: '#9ca3af'
                }}></i>
              </div>

              {/* Theme Toggle */}
              <button
                onClick={toggleTheme}
                style={{
                  padding: '8px',
                  borderRadius: '50%',
                  border: 'none',
                  backgroundColor: 'transparent',
                  cursor: 'pointer'
                }}
              >
                <i className={`fas ${isDarkMode ? 'fa-sun' : 'fa-moon'}`} style={{
                  color: isDarkMode ? '#eab308' : '#6b7280'
                }}></i>
              </button>

              {/* Notifications */}
              <button style={{
                position: 'relative',
                padding: '8px',
                borderRadius: '50%',
                border: 'none',
                backgroundColor: 'transparent',
                cursor: 'pointer'
              }}>
                <i className="fas fa-bell" style={{ color: '#6b7280' }}></i>
                <span style={{
                  position: 'absolute',
                  top: '-4px',
                  right: '-4px',
                  width: '12px',
                  height: '12px',
                  backgroundColor: '#ef4444',
                  borderRadius: '50%'
                }}></span>
              </button>

              {/* Profile */}
              <img
                src="https://images.unsplash.com/photo-1612349317150-e413f6a5b16d?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1740&q=80"
                alt="Profile"
                style={{
                  width: '32px',
                  height: '32px',
                  borderRadius: '50%',
                  objectFit: 'cover'
                }}
              />
              <span style={{
                display: window.innerWidth < 640 ? 'none' : 'block',
                fontSize: '14px',
                fontWeight: '500',
                color: '#374151'
              }}>
                Dr. Michael Chen
              </span>
              <i className="fas fa-chevron-down" style={{ color: '#9ca3af', fontSize: '12px' }}></i>
            </div>
          </div>

          {/* Main Content Area */}
          <main style={{ padding: '24px' }}>
            {/* Home Page */}
            {activeMenuItem === 'home' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                {/* Breadcrumb */}
                <nav style={{ fontSize: '14px', color: '#6b7280' }}>
                  <span>Home</span> <i className="fas fa-chevron-right" style={{ margin: '0 8px' }}></i> 
                  <span style={{ color: '#1f2937' }}>Dashboard</span>
                </nav>

                {/* Quick Doctor Info */}
                <div className="card" style={{ padding: '24px' }}>
                  <div style={{
                    display: 'flex',
                    flexDirection: window.innerWidth < 1024 ? 'column' : 'row',
                    alignItems: window.innerWidth < 1024 ? 'flex-start' : 'center',
                    justifyContent: 'space-between',
                    gap: '16px'
                  }}>
                    <div style={{
                      display: 'flex',
                      flexDirection: window.innerWidth < 640 ? 'column' : 'row',
                      alignItems: window.innerWidth < 640 ? 'flex-start' : 'center',
                      gap: '24px'
                    }}>
                      <div style={{ position: 'relative' }}>
                        <img
                          src="https://images.unsplash.com/photo-1612349317150-e413f6a5b16d?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1740&q=80"
                          alt="Doctor Photo"
                          style={{
                            width: '96px',
                            height: '96px',
                            borderRadius: '50%',
                            objectFit: 'cover',
                            border: '4px solid white',
                            boxShadow: '0 10px 15px -3px rgba(0, 0, 0, 0.1)'
                          }}
                        />
                        <div style={{
                          position: 'absolute',
                          bottom: 0,
                          right: 0,
                          width: '24px',
                          height: '24px',
                          backgroundColor: '#10b981',
                          border: '2px solid white',
                          borderRadius: '50%'
                        }}></div>
                      </div>
                      <div>
                        <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: '0 0 8px 0' }}>Dr. Michael Chen</h1>
                        <p style={{ color: '#6b7280', margin: '0 0 4px 0' }}>Cardiologist  License: MD-2024-001</p>
                        <p style={{ color: '#9ca3af', display: 'flex', alignItems: 'center', margin: '4px 0' }}>
                          <i className="fas fa-envelope" style={{ marginRight: '8px' }}></i>dr.chen@medconnect.com
                        </p>
                        <p style={{ color: '#9ca3af', display: 'flex', alignItems: 'center', margin: '4px 0' }}>
                          <i className="fas fa-phone" style={{ marginRight: '8px' }}></i>+1 (555) 987-6543
                        </p>
                      </div>
                    </div>
                    <div style={{
                      display: 'flex',
                      flexDirection: window.innerWidth < 640 ? 'column' : 'row',
                      gap: '12px'
                    }}>
                      <button
                        onClick={() => alert('Patient registration form would open here.')}
                        style={{
                          padding: '8px 16px',
                          backgroundColor: '#059669',
                          color: 'white',
                          border: 'none',
                          borderRadius: '8px',
                          cursor: 'pointer'
                        }}
                      >
                        <i className="fas fa-user-plus" style={{ marginRight: '8px' }}></i>Add Patient
                      </button>
                      <button
                        onClick={() => alert('Full schedule view would open here.')}
                        style={{
                          padding: '8px 16px',
                          border: '1px solid #d1d5db',
                          color: '#374151',
                          backgroundColor: 'transparent',
                          borderRadius: '8px',
                          cursor: 'pointer'
                        }}
                      >
                        <i className="fas fa-calendar" style={{ marginRight: '8px' }}></i>View Schedule
                      </button>
                    </div>
                  </div>
                </div>

                {/* Summary Cards */}
                <div className="dashboard">
                  <div className="cards">
                    <div className="card">
                      <div style={{ display: 'flex', alignItems: 'center' }}>
                        <div style={{
                          padding: '12px',
                          borderRadius: '50%',
                          backgroundColor: '#dbeafe'
                        }}>
                          <i className="fas fa-users" style={{ color: '#2563eb' }}></i>
                        </div>
                        <div style={{ marginLeft: '16px' }}>
                          <p style={{ fontSize: '14px', fontWeight: '500', color: '#6b7280', margin: '0 0 4px 0' }}>Total Patients</p>
                          <p style={{ fontSize: '32px', fontWeight: '600', color: '#111827', margin: '0 0 4px 0' }}>247</p>
                          <p style={{ fontSize: '12px', color: '#059669', margin: 0 }}>+12 this month</p>
                        </div>
                      </div>
                    </div>

                    <div className="card">
                      <div style={{ display: 'flex', alignItems: 'center' }}>
                        <div style={{
                          padding: '12px',
                          borderRadius: '50%',
                          backgroundColor: '#dcfce7'
                        }}>
                          <i className="fas fa-calendar-check" style={{ color: '#059669' }}></i>
                        </div>
                        <div style={{ marginLeft: '16px' }}>
                          <p style={{ fontSize: '14px', fontWeight: '500', color: '#6b7280', margin: '0 0 4px 0' }}>Today's Appointments</p>
                          <p style={{ fontSize: '32px', fontWeight: '600', color: '#111827', margin: '0 0 4px 0' }}>8</p>
                          <p style={{ fontSize: '12px', color: '#2563eb', margin: 0 }}>Next: 10:30 AM</p>
                        </div>
                      </div>
                    </div>

                    <div className="card">
                      <div style={{ display: 'flex', alignItems: 'center' }}>
                        <div style={{
                          padding: '12px',
                          borderRadius: '50%',
                          backgroundColor: '#f3e8ff'
                        }}>
                          <i className="fas fa-prescription-bottle" style={{ color: '#7c3aed' }}></i>
                        </div>
                        <div style={{ marginLeft: '16px' }}>
                          <p style={{ fontSize: '14px', fontWeight: '500', color: '#6b7280', margin: '0 0 4px 0' }}>Prescriptions Today</p>
                          <p style={{ fontSize: '32px', fontWeight: '600', color: '#111827', margin: '0 0 4px 0' }}>15</p>
                          <p style={{ fontSize: '12px', color: '#059669', margin: 0 }}>3 pending review</p>
                        </div>
                      </div>
                    </div>

                    <div className="card">
                      <div style={{ display: 'flex', alignItems: 'center' }}>
                        <div style={{
                          padding: '12px',
                          borderRadius: '50%',
                          backgroundColor: '#fef3c7'
                        }}>
                          <i className="fas fa-exclamation-triangle" style={{ color: '#d97706' }}></i>
                        </div>
                        <div style={{ marginLeft: '16px' }}>
                          <p style={{ fontSize: '14px', fontWeight: '500', color: '#6b7280', margin: '0 0 4px 0' }}>Urgent Cases</p>
                          <p style={{ fontSize: '32px', fontWeight: '600', color: '#111827', margin: '0 0 4px 0' }}>3</p>
                          <p style={{ fontSize: '12px', color: '#dc2626', margin: 0 }}>Requires attention</p>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>

                {/* Recent Activity */}
                <div className="card">
                  <div style={{
                    padding: '24px',
                    borderBottom: '1px solid #e5e7eb',
                    marginBottom: '24px'
                  }}>
                    <h2 style={{ fontSize: '18px', fontWeight: '600', color: '#111827', margin: 0 }}>Recent Activity</h2>
                  </div>
                  <div style={{ padding: '0 24px 24px' }}>
                    <div style={{ display: 'flex', flexDirection: 'column', gap: '16px' }}>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
                        <div style={{ width: '8px', height: '8px', backgroundColor: '#10b981', borderRadius: '50%' }}></div>
                        <div style={{ flex: 1 }}>
                          <p style={{ fontSize: '14px', color: '#111827', margin: '0 0 4px 0' }}>Completed consultation with Sarah Johnson</p>
                          <p style={{ fontSize: '12px', color: '#6b7280', margin: 0 }}>30 minutes ago</p>
                        </div>
                      </div>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
                        <div style={{ width: '8px', height: '8px', backgroundColor: '#3b82f6', borderRadius: '50%' }}></div>
                        <div style={{ flex: 1 }}>
                          <p style={{ fontSize: '14px', color: '#111827', margin: '0 0 4px 0' }}>Updated prescription for John Smith</p>
                          <p style={{ fontSize: '12px', color: '#6b7280', margin: 0 }}>1 hour ago</p>
                        </div>
                      </div>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
                        <div style={{ width: '8px', height: '8px', backgroundColor: '#eab308', borderRadius: '50%' }}></div>
                        <div style={{ flex: 1 }}>
                          <p style={{ fontSize: '14px', color: '#111827', margin: '0 0 4px 0' }}>New urgent case assigned: Emma Davis</p>
                          <p style={{ fontSize: '12px', color: '#6b7280', margin: 0 }}>2 hours ago</p>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            )}

            {/* My Patients Page */}
            {activeMenuItem === 'patients' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                <nav style={{ fontSize: '14px', color: '#6b7280' }}>
                  <span>Home</span> <i className="fas fa-chevron-right" style={{ margin: '0 8px' }}></i> 
                  <span style={{ color: '#1f2937' }}>My Patients</span>
                </nav>

                <div style={{
                  display: 'flex',
                  flexDirection: window.innerWidth < 640 ? 'column' : 'row',
                  alignItems: window.innerWidth < 640 ? 'flex-start' : 'center',
                  justifyContent: 'space-between',
                  gap: '16px'
                }}>
                  <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: 0 }}>My Patients</h1>
                  <button 
                    onClick={() => alert('Add New Patient form would open here.')}
                    style={{
                      padding: '8px 16px',
                      backgroundColor: '#059669',
                      color: 'white',
                      border: 'none',
                      borderRadius: '8px',
                      cursor: 'pointer'
                    }}
                  >
                    <i className="fas fa-user-plus" style={{ marginRight: '8px' }}></i>Add New Patient
                  </button>
                </div>

                <div className="card">
                  <div style={{
                    padding: '24px',
                    borderBottom: '1px solid #e5e7eb',
                    marginBottom: '0'
                  }}>
                    <h2 style={{ fontSize: '18px', fontWeight: '600', color: '#111827', margin: 0 }}>Patient List</h2>
                  </div>
                  <div className="table-container">
                    <table>
                      <thead style={{ backgroundColor: '#f9fafb' }}>
                        <tr>
                          <th style={{ fontSize: '12px', fontWeight: '500', color: '#6b7280', textTransform: 'uppercase', textAlign: 'left' }}>Patient</th>
                          <th style={{ fontSize: '12px', fontWeight: '500', color: '#6b7280', textTransform: 'uppercase', textAlign: 'left' }}>Age</th>
                          <th style={{ fontSize: '12px', fontWeight: '500', color: '#6b7280', textTransform: 'uppercase', textAlign: 'left' }}>Condition</th>
                          <th style={{ fontSize: '12px', fontWeight: '500', color: '#6b7280', textTransform: 'uppercase', textAlign: 'left' }}>Last Visit</th>
                          <th style={{ fontSize: '12px', fontWeight: '500', color: '#6b7280', textTransform: 'uppercase', textAlign: 'left' }}>Status</th>
                          <th style={{ fontSize: '12px', fontWeight: '500', color: '#6b7280', textTransform: 'uppercase', textAlign: 'left' }}>Actions</th>
                        </tr>
                      </thead>
                      <tbody>
                        <tr>
                          <td>
                            <div style={{ display: 'flex', alignItems: 'center' }}>
                              <img style={{ height: '40px', width: '40px', borderRadius: '50%', objectFit: 'cover' }} src="https://images.unsplash.com/photo-1494790108755-2616b612b8c5?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=334&q=80" alt="" />
                              <div style={{ marginLeft: '16px' }}>
                                <div style={{ fontSize: '14px', fontWeight: '500', color: '#111827' }}>Sarah Johnson</div>
                                <div style={{ fontSize: '14px', color: '#6b7280' }}>PAT-2024-001</div>
                              </div>
                            </div>
                          </td>
                          <td style={{ fontSize: '14px', color: '#111827' }}>39</td>
                          <td style={{ fontSize: '14px', color: '#111827' }}>Hypertension</td>
                          <td style={{ fontSize: '14px', color: '#111827' }}>Feb 1, 2024</td>
                          <td>
                            <span style={{
                              padding: '4px 8px',
                              backgroundColor: '#dcfce7',
                              color: '#166534',
                              fontSize: '12px',
                              borderRadius: '9999px'
                            }}>Stable</span>
                          </td>
                          <td style={{ fontSize: '14px' }}>
                            <button 
                              onClick={() => alert('Opening detailed view for Sarah Johnson')}
                              style={{
                                color: '#059669',
                                background: 'none',
                                border: 'none',
                                cursor: 'pointer',
                                marginRight: '12px'
                              }}
                            >
                              View
                            </button>
                            <button 
                              onClick={() => alert('Edit functionality would be implemented here with a modal form.')}
                              style={{
                                color: '#2563eb',
                                background: 'none',
                                border: 'none',
                                cursor: 'pointer'
                              }}
                            >
                              Edit
                            </button>
                          </td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            )}

            {/* Other pages */}
            {activeMenuItem === 'appointments' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: 0 }}>Appointments</h1>
                <p style={{ color: '#6b7280' }}>Appointments page content would go here.</p>
              </div>
            )}

            {activeMenuItem === 'prescriptions' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: 0 }}>Prescriptions</h1>
                <p style={{ color: '#6b7280' }}>Prescriptions page content would go here.</p>
              </div>
            )}

            {activeMenuItem === 'analytics' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: 0 }}>Health Analytics</h1>
                <p style={{ color: '#6b7280' }}>Analytics page content would go here.</p>
              </div>
            )}

            {activeMenuItem === 'account' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: 0 }}>Profile</h1>
                <p style={{ color: '#6b7280' }}>Profile page content would go here.</p>
              </div>
            )}

            {activeMenuItem === 'settings' && (
              <div style={{ display: 'flex', flexDirection: 'column', gap: '24px' }}>
                <h1 style={{ fontSize: '32px', fontWeight: 'bold', color: '#111827', margin: 0 }}>Settings</h1>
                <p style={{ color: '#6b7280' }}>Settings page content would go here.</p>
              </div>
            )}
          </main>
        </div>
      </div>
    </>
  );
}

export default AdminDashboard;
